import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function PastResumesTable({ onSelect }) {
  const [rows, setRows] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(()=> {
    async function fetchAll(){
      try {
        const res = await axios.get('/api/resumes');
        setRows(res.data);
      } catch (err) {
        console.error(err);
      } finally {
        setLoading(false);
      }
    }
    fetchAll();
  }, []);

  if (loading) return <div>Loading...</div>;

  return (
    <div>
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-4 py-2 text-left text-sm font-medium text-gray-500">File</th>
              <th className="px-4 py-2 text-left text-sm font-medium text-gray-500">Name</th>
              <th className="px-4 py-2 text-left text-sm font-medium text-gray-500">Email</th>
              <th className="px-4 py-2 text-left text-sm font-medium text-gray-500">Uploaded</th>
              <th className="px-4 py-2 text-left text-sm font-medium text-gray-500">Actions</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {rows.map(r=>(
              <tr key={r._id}>
                <td className="px-4 py-2 text-sm">{r.fileName}</td>
                <td className="px-4 py-2 text-sm">{r.analysis?.name || '—'}</td>
                <td className="px-4 py-2 text-sm">{r.analysis?.email || '—'}</td>
                <td className="px-4 py-2 text-sm">{new Date(r.uploadedAt).toLocaleString()}</td>
                <td className="px-4 py-2 text-sm">
                  <button className="bg-indigo-600 text-white px-3 py-1 rounded" onClick={()=>onSelect(r)}>Details</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
